import { signInWithGooglePopup } from '../../utils/firebase/firebase.utils'

import './sign-in.styles.scss'

const SignIn = () => {

  const logGoogleUser = async () => {
    const respone = await signInWithGooglePopup()
    console.log(respone);

  }

  return(
    <div className='text-center pt-4'>
      <h1 className='pb-3'>Sign In Page</h1>
      <div className='lg:grid grid-cols-2 grid grid-cols-1'>
        <div className='grid grid-cols-3 grid-rows-6'>
          <button type="button" className='login-with-google-btn col-span-1 col-start-2 row-start-3 whitespace-nowrap' onClick={logGoogleUser}>Sign in with Google</button>
        </div>
      </div>
    </div>
  )
};

export default SignIn;
